import React, {useState} from 'react'
import './TinderCards.css';

function TinderCards() {
    const[people, setPeople] = useState([
        {
            name: 'Elon Musk',
            url: "https://cdn.vox-cdn.com/thumbor/nDW7YqKV8soKsZSfRorGXJLSH50=/1400x1400/filters:format(jpeg)/cdn.vox-cdn.com/uploads/chorus_asset/file/22147179/1229892934.jpg",
        },
        {
            name: 'Jeff Bezos',
            url: "https://image.cnbcfm.com/api/v1/image/105815446-1553624918736gettyimages-1078542150.jpeg?v=1612303414",
        }
    ]);

    return (
        <div className="tinderCards">
            {people.map(person => (
                <h1 key="1">{person.name}</h1>
            ))}
        </div>
    )
}

export default TinderCards

